}
#wrap h1 {
    padding-top:120px;
    margin-bottom:30px;
    font-size:2.5rem;/* 40px */
    font-weight:700;/* bold */
}
#wrap > p {}/* #wrap 모든 자식 p */
#wrap h1+p {
    background-color:yellow;
    margin-bottom:106px;
}/* #wrap의 h1 옆에 p */
#wrap #login_frm {
    background-color:lime;
}
#wrap #login_frm h2 {
    font-size:1.375rem;
    font-weight:600;
    margin-bottom:13px;
}
#wrap #login_frm p {}
#wrap #login_frm p.user_in {margin-bottom:38px;}
#wrap #login_frm p.user_btn {margin-bottom:10px;}
#wrap #login_frm p input::placeholder {/* placeholder 속성선택자작성법 */
    font-size:0.875rem;
